import React, { Component } from 'react';
import Slider from "react-slick";
import "./home.modules.css"
import img1 from "../../assets/fp1.jpeg";
import img2 from "../../assets/fp2.jpeg";
import img3 from "../../assets/fp3.jpeg";


export default class Home extends Component {
  render() {
    const settings = {
      dots: true,
      infinite: true,
      speed: 500,
      slidesToShow: 1,
      slidesToScroll: 1,
      className: "slider"
    };

    return (
      <Slider {...settings}>
        <div className="slide">
          <div className="image" > <img src={img1} alt="img1"/> </div>
          <div className="description">
            <h2>Event 1</h2>
            <p>Description for Event 1</p>
          </div>
        </div>
        <div className="slide">
          <div className="image" > <img src={img2} alt="img2"/> </div>
          <div className="description">
            <h2>Event 2</h2>
            <p>Description for Event 2</p>
          </div>
        </div>
        <div className="slide">
          <div className="image" > <img src={img3} alt="img3"/> </div>
          <div className="description">
            <h2>Event 3</h2>
            <p>Description for Event 3</p>
          </div>
        </div>
      </Slider>
    );
  }
}
